import React from 'react';
import { useParams } from 'react-router-dom';

export default function ProjectDetail() {
  const { id } = useParams();

  return (
    <div className="min-h-screen bg-black text-white p-10">
      <h1 className="text-3xl font-bold mb-4">Detail Project: {id}</h1>
      <p className="text-gray-300">
        This is the detail page for project <strong>{id}</strong>. You can add more content, images, or descriptions here.
      </p>
    </div>
  );
}
